            transitionType={"SCALE"}
            transitionDuration={200}
            isActive={true}
        /> */}
        {
          images?.map((data, index)=>(
            <div key = {index} style = {{
              width : "200px",
              margin : "5px",
              borderRadius : "20px"
            }}>
              <img src = {data} style = {{objectFit : "center", width : "100%"}}/>
            </div>
          ))
        }

    </div>
  )
}

export default ClientGrid
